script: |
  super -f text -I q5625.spq | sort > q5625.out

inputs:
  - name: q5625.spq
    data: |
      SELECT - ( + col1 ) FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( ( - col2 ) * 51 + col1 * - ( - col1 ) ) IS NULL;
  - name: tab0

outputs:
  - name: q5625.out
    data: |
      -1
      -21
      -81
